import React, { useState, useEffect } from 'react'

const Color = {
  Gary: 'gray',
  Black: 'black'
}
const STEP = {
  INIT: 0,
  UP: 1,
  DOWN: 2
}

export function TableSort(props) {
  let StepNum = props.stepNum || STEP.INIT
  const [upColor, setUpColor] = useState(Color.Gary)
  const [downColor, setDownColor] = useState(Color.Gary)

  function changeState() {
    if (StepNum === STEP.INIT) {
      setUpColor(Color.Gary)
      setDownColor(Color.Gary)
    } else if (StepNum === STEP.UP) {
      setUpColor(Color.Black)
      setDownColor(Color.Gary)
    } else if (StepNum === STEP.DOWN) {
      setUpColor(Color.Gary)
      setDownColor(Color.Black)
    }
  }

  const setStep = () => {
    StepNum !== STEP.DOWN ? StepNum++ : (StepNum = STEP.INIT)
    changeState()
    props.clickSort(StepNum)
  }

  useEffect(() => {
    changeState()
  }, [])

  useEffect(() => {
    changeState()
  }, [props.stepNum])

  return (
    <div className='fx ai-c'>
      {props.name}
      <svg onClick={setStep} className='cp'>
        <path d='M4 2 L0 8 L8 8 Z' fill={upColor} />
        <path d='M4 15 L0 9 L8 9 Z' fill={downColor} />
      </svg>
    </div>
  )
}

import React, { useState, useEffect } from 'react'
