const initFormData = {
  dependency_type: ''
}

export default function () {
  const { report_name } = window.reportData.project_info
  const { indirect, direct } = window.reportData.statistics.dependency

  const [formData, setFormData] = useState({
    ...initFormData
  })
  const [tableList, setTableList] = useState({
    list: window.reportData.dependency_info_list
  })

  function queryClick() {
    filterList()
  }

  function filterList() {
    let tempArr = []
    for (const item of window.reportData.dependency_info_list) {
      if (item.dependency_type === formData.dependency_type || formData.dependency_type === 'all') {
        tempArr.push(item)
      }
    }
    setTableList({ list: tempArr })
  }

  function initClick() {
    setFormData(initFormData)
    setTableList({ list: window.reportData.dependency_info_list })
  }

  useEffect(() => {}, [formData])

  return (
    <SecBox index='6' icon='depend' title='依赖'>
