        <p>
          <span>{report_name}</span>检测过程中检测到 <span>{indirect + direct}</span>个依赖，其中直接依赖{' '}
          <span>{direct}</span>个、间接依赖 <span>{indirect}</span>个，依赖详情如下
        </p>
      </div>
      <form className='search-box fx'>
        <div className='form-item'>
          <label>依赖类型: </label>
          <select
            onChange={(e) => setFormData({ ...formData, dependency_type: e.target.value })}
            value={formData.dependency_type}>
            <option value='all'>全部</option>
            <option value='直接依赖'>直接依赖</option>
            <option value='间接依赖'>间接依赖</option>
          </select>
        </div>
        <button type='button' className='btn btn-secondary' onClick={() => initClick()}>
          重置
        </button>
        <button type='button' className='btn btn-primary' onClick={() => queryClick()}>
          查询
        </button>
      </form>
      <table cellSpacing='0'>
        <thead>
          <tr>
            <th>依赖名称</th>
            <th>依赖版本</th>
            <th>依赖类型</th>
          </tr>
        </thead>
        <tbody>
          {tableList.list.map((item, index) => (
            <tr key={index}>
              <td>{item.dependency_component}</td>
              <td>{item.dependency_version}</td>
              <td>{item.dependency_type}</td>
            </tr>
          ))}
        </tbody>
