      filterList()
      return
    } else if (_step === 1) {
      _list.sort((pre, next) => {
        return next.cvss3_base_score - pre.cvss3_base_score
      })
    } else if (_step === 2) {
      _list.sort((pre, next) => {
        return pre.cvss3_base_score - next.cvss3_base_score
      })
    }
    setcomponentCountSort(0)
    setTableList({ list: _list })
  }

  function clickSort1(_step) {
    setcomponentCountSort(_step)
    let _list = [...tableList.list]
    if (_step === 0) {
      filterList()
      return
    } else if (_step === 1) {
      _list.sort((pre, next) => {
        return next.component_count - pre.component_count
      })
    } else if (_step === 2) {
      _list.sort((pre, next) => {
        return pre.component_count - next.component_count
      })
    }
    setCvss3Sort(0)
    setTableList({ list: _list })
  }

  function queryClick() {
    filterList()
  }

  function filterList() {
    let tempArr = []
    for (const item of window.reportData.vun_info.vun_info_list) {
      if (
        item.cve_num.indexOf(formData.cve_num) >= 0 &&
        item.cwe_id.indexOf(formData.cwe_id) >= 0 &&
        (item.cvss3_base_level === formData.cvss3_base_level || formData.cvss3_base_level === 'all') &&
        (item.is_public_poc === formData.is_public_poc || formData.is_public_poc === 'all')
      ) {
        tempArr.push(item)
      }
    }
    setTableList({ list: tempArr })
  }

  function initClick() {
    setFormData(initFormData)
    setTableList({ list: window.reportData.vun_info.vun_info_list })
    setCvss3Sort(0)
    setcomponentCountSort(0)
  }

  function expClick(item, key) {
    const tempArr = expandArr.arr
    let arrIndex = tempArr.indexOf(item[key])
    arrIndex >= 0 ? tempArr.splice(arrIndex, 1) : tempArr.push(item[key])
    setExpandArr({ arr: tempArr })
  }

  function tableChildRenderer(item) {
    return expandArr.arr.includes(item.id) ? (
      <tr>
        <td colSpan='10' className='in-td'>
          <table cellSpacing='0'>
            <thead>
              <tr>
                <th>组件名</th>
                <th>当前版本</th>
                <th>组件链接</th>
              </tr>
            </thead>
            <tbody>
              {item.component_info_list.map((sonItem, index) => (
                <tr key={index}>
                  <td>{sonItem.component}</td>
                  <td>{sonItem.version}</td>
                  <td>
                    <a href={sonItem.url} target='_blank'>
                      {sonItem.url}
                    </a>
                  </td>
                </tr>
              ))}
            </tbody>
          </table>
        </td>
      </tr>
    ) : (
      <></>
    )
  }

  return (
    <>
      <div className='desc'>
        <div className='sub-title fx ai-c'>
          <div className='dot' />
          3.1 漏洞详情
        </div>
        <p>
          <span>{report_name}</span> 中检测出：<span>{total}</span>个漏洞，<span> {count} </span>个开源组件，
          <span> {risk_count} </span>
          个开源组件存在漏洞，<span> {is_public_poc} </span>个漏洞存在可利用POC，漏洞详情如下：
        </p>
        <div className='fx'>
          <WarnBox color='super' level='超危' value={_spuer} />
          <WarnBox color='high' level='高危' value={high} />
          <WarnBox color='mid' level='中危' value={mid} />
          <WarnBox color='low' level='低危' value={low} />
        </div>
      </div>
      <form className='search-box fx'>
        <div className='form-item'>
          <label>CVE编号: </label>
          <input
            placeholder='请输入'
            value={formData.cve_num}
            onChange={(e) => setFormData({ ...formData, cve_num: e.target.value })}></input>
        </div>
        <div className='form-item'>
          <label>CWE编号: </label>
          <input
            placeholder='请输入'
            value={formData.cwe_id}
            onChange={(e) => setFormData({ ...formData, cwe_id: e.target.value })}></input>
        </div>
        <div className='form-item'>
          <label>漏洞等级: </label>
          <select
            onChange={(e) => setFormData({ ...formData, cvss3_base_level: e.target.value })}
            value={formData.cvss3_base_level}>
            <option value='all'>全部</option>
            <option value='超危'>超危</option>
            <option value='高危'>高危</option>
            <option value='中危'>中危</option>
            <option value='低危'>低危</option>
            {/* <option value='未评测'>未评测</option> */}
          </select>
        </div>
        <div className='form-item'>
          <label>可利用POC: </label>
          <select
            onChange={(e) => setFormData({ ...formData, is_public_poc: e.target.value })}
            value={formData.is_public_poc}>
            <option value='all'>全部</option>
            <option value='是'>是</option>
            <option value='否'>否</option>
          </select>
        </div>
        <button type='button' className='btn btn-secondary' onClick={() => initClick()}>
          重置
        </button>
        <button type='button' className='btn btn-primary' onClick={() => queryClick()}>
          查询
        </button>
      </form>
      <table cellSpacing='0'>
        <thead>
          <tr>
            <th className='expand' />
            <th>漏洞名称</th>
            <th>CVE编号</th>
            <th>CNNVD编号</th>
            <th>CWE 编号</th>
            <th width='9%'>漏洞等级</th>
            <th width='12%'>
              <TableSort name='CVSS3分值' clickSort={clickSort} stepNum={cvss3Sort} />
            </th>
            <th width='9%'>威胁类型</th>
            <th>可利用POC</th>
            <th width='9%'>
              <TableSort name='组件数' clickSort={clickSort1} stepNum={componentCountSort} />
            </th>
          </tr>
        </thead>
        <tbody>
          {tableList.list.map((item, index) => (
            <React.Fragment key={item.id}>
              <tr key={index}>
                <td className='expandBtn'>
                  {item.component_info_list.length === 0 ? (
                    <></>
                  ) : (
                    <div
                      className={expandArr.arr.includes(item.id) ? 'closed-icon' : 'expand-icon'}
                      onClick={() => expClick(item, 'id')}
                    />
                  )}
                </td>
                <td>{item.cnnvd_vul_name}</td>
                <td>{item.cve_num}</td>
                <td>{item.cnnvd_num}</td>
                <td>{item.cwe_id}</td>
                <td>{item.cvss3_base_level}</td>
                <td>{item.cvss3_base_score}</td>
                <td>{item.cnnvd_threat}</td>
                <td>{item.is_public_poc}</td>
                <td>{item.component_count}</td>
              </tr>
              {tableChildRenderer(item, 'id')}
            </React.Fragment>
          ))}
        </tbody>
      </table>
    </>
  )
}

